/*hisUser = 'SEAN'*/                                                                            
command = 'LISTUSER' ${instance-hisUser} 'OMVS'                          
ADDRESS "TSO"                                                            
variables.0 = 1                                                          
variables.1 = 'omvs_segment = USER_MISSING'                                        
CALL OUTTRAP out.                                                        
command                                                                  
DO i=1 TO out.0                                   
   IF POS('OMVS INFORMATION',out.i) = 1 THEN DO   
       say out.i                                  
       say;say POS('OMVS INFORMATION',out.i)      
       variables.1 = 'omvs_segment = VERIFIED'    
       leave                                      
   END                                            
   IF POS('NO OMVS INFORMATION',out.i) > 0 THEN DO
       say out.i                                  
       say;say POS('NO OMVS INFORMATION',out.i)   
       variables.1 = 'omvs_segment = OMVS_MISSING'
       leave                                      
   END                                            
END                                                                                                               
SAY;SAY "Write the data listed above to output to update variables",
          || " in the workflow.";SAY                                      
ADDRESS SYSCALL "writefile $_output 777 variables."                      
IF RC = 0 THEN DO                                                        
    SAY "WRITE SUCCESSFUL"                                               
    SAY;SAY "Variables in workflow have been updated."                   
END                                                                      
ELSE DO                                                                  
    SAY "WRITE FAILED"                                                   
    SAY;SAY "Variables in workflow have NOT been updated."               
END

//****************************************************************                                      
//* FTP PARMS                                                                   
