//NETRC DD SYSOUT=*                                                             
//SYSMDUMP DD SYSOUT=*                                                          
//SYSPRINT DD SYSOUT=A                                                          
//OUTPUT DD SYSOUT=*                                                            
//INPUT DD *                                                                    
WORKFLOW
HISWKFLW                                                                       
cd TEST
bin                                                                             
put '${instance-hispaxzFile}'                                                   
quit
